classdef LinkDetails<handle




    properties(Constant)

        bulletIcon='data:image/png;base64,';

        unknownIcon='data:image/png;base64,';
        staleIcon='data:image/png;base64,';
        passedIcon='data:image/png;base64,';
        failedIcon='data:image/png;base64,';

        codeIcon='data:image/png;base64,';
        whiteIcon='data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAMAAAAOCAYAAADqtqZhAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAAEnQAABJ0Ad5mH3gAAAAHdElNRQfgARoCFCTJfciDAAAAFklEQVQYV2P8DwQMUMAEpcFg8HIYGADV+gQYnKZUUAAAAABJRU5ErkJggg==';
        deletIcon='data:image/png;base64,';
    end

    methods(Static)
        function infoStruct=getLinkInfo(dasReqOrBlkH)



            infoStruct=struct([]);
            mfLinkTypes=slreq.utils.getAllLinkTypes();
            rData=slreq.data.ReqData.getInstance();
            isForReq=isa(dasReqOrBlkH,'slreq.das.Requirement');
            for nLinkType=1:length(mfLinkTypes)

                thisMFLinkType=mfLinkTypes(nLinkType);
                thisLinkTypeName=thisMFLinkType.typeName;
                if isForReq
                    [inLinks,outLinks]=dasReqOrBlkH.getLinks(thisLinkTypeName);
                else
                    [inLinks,outLinks]=rData.getLinksForNonReqItem(dasReqOrBlkH,thisLinkTypeName);
                end

                for n=1:length(inLinks)

                    cLink=inLinks(n);
                    linkSrc=cLink.source;
                    isSrcValid=linkSrc.isValid;
                    if isSrcValid
                        [adapter,artifact,id]=linkSrc.getAdapter();
                        if~isempty(adapter)
                            infoStruct(end+1).functionName=adapter.getClickActionCommandString(artifact,id,'standalone');%#ok<AGROW> 
                            infoStruct(end).resource=artifact;
                            infoStruct(end).linkedID=id;
                            infoStruct(end).linkUUID=cLink.getUuid;
                        else


                            infoStruct(end+1).functionName=slreq.gui.LinkTargetUIProvider.getClickActionCommandString(linkSrc,'standalone');%#ok<AGROW> 
                            infoStruct(end).resource=linkSrc.artifactUri;
                            infoStruct(end).linkedID=linkSrc.artifactId;
                            infoStruct(end).linkUUID=cLink.getUuid;

                        end
                    end
                end

                for n=1:length(outLinks)
                    cLink=outLinks(n);
                    linkDst=cLink.dest;
                    if slreq.utils.hasValidDest(cLink)
                        [adapter,artifact,id]=linkDst.getAdapter();
                        if~isempty(adapter)
                            infoStruct(end+1).functionName=adapter.getClickActionCommandString(artifact,id,'standalone');%#ok<AGROW> 
                            infoStruct(end).resource=artifact;
                            infoStruct(end).linkedID=id;
                            infoStruct(end).linkUUID=cLink.getUuid;
                        else


                            infoStruct(end+1).functionName=slreq.gui.LinkTargetUIProvider.getClickActionCommandString(linkDst,'standalone');%#ok<AGROW> 
                            infoStruct(end).resource=linkDst.artifactUri;
                            infoStruct(end).linkedID=linkDst.artifactId;
                            infoStruct(end).linkUUID=cLink.getUuid;


                        end
                    end
                end
            end
        end

        function dlgstruct=getDialogSchema(dasReqOrObjH,caller)

            persistent dlginfo;
            if~isempty(dlginfo)...
                &&~isempty(dasReqOrObjH)...
                &&isa(dasReqOrObjH,'slreq.das.Requirement')...
                &&dasReqOrObjH.IsSleeping
                dlgstruct=dlginfo;
                return;
            end

            dlgstruct.LayoutGrid=[1,1];

            webTable=struct('Type','webbrowser','RowSpan',[1,1],...
            'ColSpan',[1,1],...
            'Tag','ReqLinksDDG',...
            'WebKit',true);

            noLinks=false;
            isDas=false;
            if isempty(dasReqOrObjH)
                noLinks=true;
            else
                if isa(dasReqOrObjH,'slreq.das.Requirement')
                    [thisInLinks,thisOutLinks]=dasReqOrObjH.getLinks;
                    isDas=true;
                else
                    reqData=slreq.data.ReqData.getInstance();
                    [thisInLinks,thisOutLinks]=reqData.getLinksForNonReqItem(dasReqOrObjH);
                end
                if isempty(thisInLinks)&&isempty(thisOutLinks)
                    noLinks=true;
                end

            end
            if noLinks

                dlgstruct.Name=getString(message('Slvnv:slreq:Links'));
                webTable=struct('Type','webbrowser','RowSpan',[1,1],...
                'ColSpan',[1,1],...
                'Tag','ReqLinksDDG',...
                'HTML',['<html> <meta charset="UTF-8"><font face="sans-serif" size="2">',getString(message('Slvnv:slreq:NoLinks')),'</font></html>'],...
                'WebKit',true);
                nRow=3;
            else
                dlgstruct.Name=getString(message('Slvnv:slreq:Links'));
                [htmlStr,nRow]=generateHTML(thisInLinks,thisOutLinks);
                webTable.HTML=htmlStr;
            end





            webTable.PreferredSize=[10,19*nRow+10];
            dlgstruct.Type='togglepanel';

            if isDas&&dasReqOrObjH.isImportRootItem()
                dlgstruct.Tag='LinkDetailsPaneTopNode';
                initialToggleState=false;
            else
                dlgstruct.Tag='LinkDetailsPane';
                initialToggleState=true;
            end

            dlgstruct.Expand=slreq.gui.togglePanelHandler('get',dlgstruct.Tag,initialToggleState);
            dlgstruct.ExpandCallback=@slreq.gui.togglePanelHandler;
            dlgstruct.Items={webTable};
            dlginfo=dlgstruct;

            function[htmlStr,nRow]=generateHTML(allInLinks,allOutLinks)
                maxToolTipLine=1;
                nRow=1;
                htmlStr='';

                mfLinkTypeNames={slreq.utils.getAllLinkTypes().typeName};
                stereoTypes=slreq.internal.ProfileLinkType.getAllStereotypesForLink([allInLinks,allOutLinks]);
                mfLinkTypeNames=[mfLinkTypeNames,stereoTypes];

                appmgr=slreq.app.MainManager.getInstance();
                if strcmpi(caller,'standalone')
                    cView=slreq.utils.getCallerView('#?#standalone#?#');
                else
                    mgr=slreq.app.MainManager.getInstance;
                    cView=mgr.getCurrentSpreadSheetObject(caller);
                end

                isViewValid=slreq.utils.isValidView(cView);

                inLinkTypeNames={allInLinks.type};
                outLinkTypeNames={allOutLinks.type};

                for nLinkType=1:length(mfLinkTypeNames)

                    thisLinkTypeName=mfLinkTypeNames{nLinkType};
                    inLinks=allInLinks(strcmp(thisLinkTypeName,inLinkTypeNames));
                    outLinks=allOutLinks(strcmp(thisLinkTypeName,outLinkTypeNames));
                    if~isempty(inLinks)


                        if slreq.internal.ProfileLinkType.isProfileStereotype(...
                            inLinks(1).getLinkSet(),thisLinkTypeName)
                            linkTypeName=slreq.internal.ProfileLinkType.getBackwardName(inLinks(1));
                        else
                            linkTypeName=slreq.app.LinkTypeManager.getBackwardName(thisLinkTypeName);
                        end




                        type=['i',thisLinkTypeName];
                        linkTypeTitle=createTypeTitle(type,[linkTypeName,':'],'i');
                        typeList=[];

                        nRow=nRow+2;
                        for n=1:length(inLinks)







                            cLink=inLinks(n);
                            dasLink=cLink.getDasObject();
                            if~isempty(dasLink)
                                if isViewValid&&cView.displayChangeInformation
                                    linkDestStatus=lower(char(dasLink.DestinationChangeStatus));
                                else
                                    linkDestStatus='pass';
                                end
                            else
                                linkDestStatus='invalid';
                            end
                            if reqmgt('rmiFeature','ChangeTrackingSltest')||...
                                regmgt('rmiFeature','MLChangeTracking')

                                if~isempty(dasLink)
                                    if isViewValid&&cView.displayChangeInformation
                                        linkSrcStatus=lower(char(dasLink.SourceChangeStatus));
                                    else
                                        linkSrcStatus='pass';
                                    end
                                else
                                    linkSrcStatus='invalid';
                                end
                            end

                            linkSrc=cLink.source;
                            linkTargetClass=getLinkTargetClass(linkSrc);
                            [adapter,artifact,id]=cLink.getSrcAdapter();
                            isSrcValid=adapter.isResolved(artifact,id);
                            srcStr=rmiut.plainToHtml(adapter.getSummary(artifact,id));
                            srcTooltip=adapter.getTooltip(artifact,id);
                            itemIconFile=adapter.getIcon(artifact,id);
                            hyperLink=adapter.getClickActionCommandString(artifact,id,caller);

                            if strcmpi(linkDestStatus,'fail')||strcmpi(linkSrcStatus,'fail')
                                srcTooltip=[srcTooltip,'<br/>',getString(message('Slvnv:slreq:LinkedReqHasChangeIssue'))];%#ok<AGROW>
                                linkStatus='fail';
                            else
                                linkStatus='pass';
                            end
                            itemHtml=createItemWithTooltip(srcStr,hyperLink,srcTooltip,'linktarget',linkStatus);
                            maxToolTipLine=updateToolTipLine(maxToolTipLine,srcTooltip);

                            isVerifyLink=slreq.app.LinkTypeManager.isa(thisLinkTypeName,slreq.custom.LinkType.Verify,cLink.getLinkSet());
                            isImplementLink=slreq.app.LinkTypeManager.isa(thisLinkTypeName,slreq.custom.LinkType.Implement,cLink.getLinkSet());

                            if isSrcValid
                                if isViewValid&&isVerifyLink&&...
                                    cView.displayVerificationStatus
                                    [imagesrc,hyperLink,tooltip]=getStatusInfo(cLink);
                                    imagehtml=createImage(imagesrc);
                                    newHtml=createItemWithTooltip(imagehtml,hyperLink,tooltip,'testresult');
                                    itemHtml=sprintf('%s%s',itemHtml,newHtml);
                                    maxToolTipLine=updateToolTipLine(maxToolTipLine,tooltip);
                                end

                                if isImplementLink&&appmgr.codeTraceabilityManager.Enabled
                                    [imagesrc,hyperLink,tooltip]=getCodeTraceabilityInfo(appmgr,cLink);
                                    imagehtml=createImage(imagesrc);
                                    newHtml=createItemWithTooltip(imagehtml,hyperLink,tooltip,'codetracing');
                                    maxToolTipLine=updateToolTipLine(maxToolTipLine,tooltip);
                                    itemHtml=sprintf('%s%s',itemHtml,newHtml);
                                end
                            end


                            linkHtml=createLinkViewItem(cLink.getUuid,caller);
                            itemHtml=sprintf('%s%s',itemHtml,linkHtml);


                            deleteHtml=createDeleteLink(cLink.getUuid);
                            itemHtml=sprintf('%s%s',itemHtml,deleteHtml);


                            listHtml=createListItem(linkTargetClass,itemHtml,itemIconFile);

                            typeList=pushList(typeList,listHtml);
                            nRow=nRow+1;
                        end
                        listHtml=createList(linkTypeTitle,type,typeList);
                        htmlStr=sprintf('%s\n%s',htmlStr,listHtml);
                    end

                    if~isempty(outLinks)


                        if slreq.internal.ProfileLinkType.isProfileStereotype(...
                            outLinks(1).getLinkSet,thisLinkTypeName)
                            linkTypeName=slreq.internal.ProfileLinkType.getForwardName(outLinks(1));
                        else
                            linkTypeName=slreq.app.LinkTypeManager.getForwardName(thisLinkTypeName);
                        end





                        type=['o',thisLinkTypeName];
                        linkTypeTitle=createTypeTitle(type,[linkTypeName,':'],'o');
                        typeList=[];

                        nRow=nRow+2;
                        for n=1:length(outLinks)
                            cLink=outLinks(n);





                            dasLink=cLink.getDasObject();
                            if~isempty(dasLink)
                                if isViewValid&&cView.displayChangeInformation
                                    linkSrcStatus=lower(char(dasLink.SourceChangeStatus));
                                else
                                    linkSrcStatus='pass';
                                end
                            else
                                linkSrcStatus='invalid';
                            end

                            linkDst=cLink.dest;
                            [adapter,artifact,id]=cLink.getDestAdapter();
                            linkDstStr=rmiut.plainToHtml(adapter.getSummary(artifact,id));
                            linkDstTooltip=adapter.getTooltip(artifact,id);
                            itemIconFile=adapter.getIcon(artifact,id);
                            navCmd=adapter.getClickActionCommandString(artifact,id,caller);



                            if~isempty(linkDst)&&adapter.isResolved(artifact,id)
                                linkTargetClass=getLinkTargetClass(linkDst);
                            else
                                linkTargetClass='unresolved-item';
                            end
                            if strcmpi(linkSrcStatus,'fail')
                                linkDstTooltip=[linkDstTooltip,'<br/>',getString(message('Slvnv:slreq:LinkedReqHasChangeIssue'))];%#ok<AGROW>
                            end

                            itemHtml=createItemWithTooltip(linkDstStr,navCmd,linkDstTooltip,'linktarget',linkSrcStatus);
                            maxToolTipLine=updateToolTipLine(maxToolTipLine,linkDstTooltip);

                            if reqmgt('rmiFeature','ExtVerif')



                                isConfirm=slreq.app.LinkTypeManager.isa(thisLinkTypeName,...
                                slreq.custom.LinkType.Confirm,cLink.getLinkSet());
                                if isViewValid&&isConfirm&&...
                                    cView.displayVerificationStatus
                                    [imagesrc,hyperLink,tooltip]=getStatusInfo(cLink);
                                    imagehtml=createImage(imagesrc);
                                    newHtml=createItemWithTooltip(imagehtml,hyperLink,tooltip,'testresult');
                                    itemHtml=sprintf('%s%s',itemHtml,newHtml);
                                    maxToolTipLine=updateToolTipLine(maxToolTipLine,tooltip);
                                end
                            end


                            linkHtml=createLinkViewItem(cLink.getUuid,caller);
                            itemHtml=sprintf('%s%s',itemHtml,linkHtml);

                            deleteHtml=createDeleteLink(cLink.getUuid);
                            itemHtml=sprintf('%s%s',itemHtml,deleteHtml);


                            listHtml=createListItem(linkTargetClass,itemHtml,itemIconFile);

                            typeList=pushList(typeList,listHtml);

                            nRow=nRow+1;
                        end
                        listHtml=createList(linkTypeTitle,type,typeList);
                        htmlStr=sprintf('%s\n%s',htmlStr,listHtml);
                    end
                end

                htmlStr=create_doc(htmlStr);
                nRow=nRow+maxToolTipLine;


                function[imagesrc,hyperlink,tooltip]=getCodeTraceabilityInfo(mgr,thisLink)

                    [hasCodeTrace,navCmd,navArg,codeTooltip]=mgr.codeTraceabilityManager.getTraceabilityInfo(thisLink);
                    if hasCodeTrace
                        imagesrc=slreq.gui.LinkDetails.codeIcon;
                        allArg=strjoin(navArg,''',''');
                        hyperlink=[navCmd,'(''',allArg,''')'];
                        tooltip=codeTooltip;
                    else
                        imagesrc='';
                        hyperlink='';
                        tooltip='';
                    end
                end

                function[imagesrc,hyperlink,tooltip]=getStatusInfo(thisLink)
                    resultsManager=slreq.data.ResultManager.getInstance();
                    [result,reason]=resultsManager.getResult(thisLink);
                    fullID=thisLink.getFullID();
                    if isempty(result)
                        tooltip=makeTooltip(getString(message('Slvnv:slreq:Unknown')),reason);
                        imagesrc=slreq.gui.LinkDetails.unknownIcon;
                        hyperlink='';
                    elseif result==slreq.verification.ResultStatus.Pass
                        tooltip=makeTooltip(getString(message('Slvnv:slreq:Passed')),reason);
                        imagesrc=slreq.gui.LinkDetails.passedIcon;
                        hyperlink=['slreq.utils.navigateFromLinkToTestResult(''',fullID,''')'];
                    elseif result==slreq.verification.ResultStatus.Fail
                        tooltip=makeTooltip(getString(message('Slvnv:slreq:Failed')),reason);
                        imagesrc=slreq.gui.LinkDetails.failedIcon;
                        hyperlink=['slreq.utils.navigateFromLinkToTestResult(''',fullID,''')'];
                    elseif result==slreq.verification.ResultStatus.Stale
                        tooltip=makeTooltip(getString(message('Slvnv:slreq:Stale')),reason);
                        imagesrc=slreq.gui.LinkDetails.staleIcon;
                        hyperlink=['slreq.utils.navigateFromLinkToTestResult(''',fullID,''')'];
                    else
                        tooltip=makeTooltip(getString(message('Slvnv:slreq:NotRun')),reason);
                        imagesrc=slreq.gui.LinkDetails.unknownIcon;
                        hyperlink='';
                    end

                    function tooltip=makeTooltip(status,reason)



                        STATUS_FORMAT='%s - %s';
                        if~isempty(reason)&&ismember(reason.type,{'info','error'})...
                            &&((ischar(reason.message)&&~isempty(reason.message))...
                            ||(isstring(reason.message)&&reason.message~=""))
                            tooltip=sprintf(STATUS_FORMAT,status,reason.message);
                        else
                            tooltip=status;
                        end

                    end
                end

                function htmlStr=create_doc(htmlStr)
                    document=Advisor.Document;

                    enc=Advisor.Element('meta','charset','UTF-8');
                    document.addHeadItem(enc);


                    css_ms=Advisor.Element('style','type','text/css');
                    css_ms.setContent(fileread(fullfile(matlabroot,'toolbox','shared',...
                    'reqmgt','icons','linkpane.css')));


                    document.addHeadItem(css_ms);


                    mjsscr=fileread(fullfile(matlabroot,'toolbox','shared',...
                    'reqmgt','icons','linkpane.js'));
                    mjs=Advisor.Element('script','type','text/javascript');
                    mjs.setContent(mjsscr);

                    document.addHeadItem(mjs);

                    document.addItem(htmlStr);

                    htmlStr=document.emitHTML;
                end
            end

        end

        function deleteLink(uuid)
            reqData=slreq.data.ReqData.getInstance();
            link=reqData.findObject(uuid);
            if~isempty(link)

                isStereotype=slreq.internal.ProfileLinkType.isProfileStereotype(...
                link.getLinkSet(),link.type);
                if isStereotype
                    linkType=slreq.internal.ProfileLinkType.getForwardName(link.type);
                else
                    linkType=slreq.app.LinkTypeManager.getForwardName(link.type);
                end
                [srcAdapter,srcArtifactUri,srcArtifactId]=link.source.getAdapter();
                linkSrcLabel=srcAdapter.getSummary(srcArtifactUri,srcArtifactId);

                [destAdapter,destArtifactUri,destArtifactId]=link.getDestAdapter();
                linkDestLabel=destAdapter.getSummary(destArtifactUri,destArtifactId);

                mgr=slreq.app.MainManager.getInstance;




                mgr.notify('SleepUI');
                cleanup=onCleanup(@()mgr.notify('WakeUI'));

                reply=questdlg(getString(message('Slvnv:slreq:DeleteLinkFromLinkDetailPane',...
                linkSrcLabel,linkType,linkDestLabel)),getString(message('Slvnv:slreq:DeleteLink')),...
                getString(message('Slvnv:slreq:Delete')),...
                getString(message('Slvnv:slreq:Cancel')),...
                getString(message('Slvnv:slreq:Cancel')));
                if isempty(reply)||strcmp(reply,getString(message('Slvnv:slreq:Cancel')))
                    return
                end



                src=link.source;
                allLinks=src.getLinks();
                origLinkCount=numel(allLinks);


                srcStruct=struct(...
                'artifactUri',src.artifactUri,...
                'domain',src.domain,...
                'id',src.id);
                if isa(src,'slreq.data.TextRange')
                    srcStruct.id=slreq.utils.getLongIdFromShortId(src.getTextNodeId(),src.id);
                end
                link.remove();


                mgr.update;


                adapter=slreq.adapters.AdapterManager.getInstance.getAdapterByDomain(srcStruct.domain);
                adapter.refreshLinkOwner(srcStruct.artifactUri,srcStruct.id,...
                rmi.createEmptyReqs(origLinkCount),rmi.createEmptyReqs(origLinkCount-1));
            end
        end

    end
end


function out=createItemWithTooltip(content,navCmd,tooltip,hyperlinkclass,status)
    if nargin<5
        status='invalid';
    end
    out=sprintf('<span class="content"><a class="%s" href="matlab:%s"><span class="%s">%s</span><span class="tooltip">%s</span></a></span> ',...
    hyperlinkclass,navCmd,status,content,tooltip);
end

function out=createTypeTitle(type,typestr,direct)
    srcicon='data:image/png;base64,';
    inarrowicon='data:image/png;base64,';
    outarrowicon='data:image/png;base64,';
    clickHandler=sprintf('toggle(this, ''%s'')',type);
    if strcmp(direct,'o')
        out=sprintf('<img id="%sicon" src="%s" onclick="%s"></img><strong> <img src="%s"></img> </strong><span class="linktype">%s</span>',type,srcicon,clickHandler,outarrowicon,typestr);
    else
        out=sprintf('<img id="%sicon" src="%s" onclick="%s"></img><strong> <img src="%s"></img> </strong><span class="linktype">%s</span>',type,srcicon,clickHandler,inarrowicon,typestr);
    end

end

function out=createImage(srcicon)
    out=sprintf('<img src="%s"></img>',srcicon);
end

function out=createListItem(~,item,iconFile)


    iconFile=strrep(iconFile,'\','/');

    out=sprintf('<li style="list-style-image:url(''file:///%s'')">%s</li>',iconFile,item);
end

function out=pushList(in,item)
    out=sprintf('%s\n%s',in,item);
end

function out=createList(titlePart,linktype,listItemsPart)
    out=sprintf('<div>\n%s\n<ul id="%s">\n%s\n</ul></div>',titlePart,linktype,listItemsPart);
end


function linkHtml=createLinkViewItem(uuid,caller)
    linkIcon='data:image/png;base64,';


    linkHyper=sprintf('slreq.app.CallbackHandler.selectObjectByUuid(''%s'',''%s'')',uuid,caller);
    linktooltip=getString(message('Slvnv:slreq:ShowInLinksView'));
    linkImage=Advisor.Image;
    linkImage.ImageSource=linkIcon;
    linkImage.setAttribute('class','showlink');

    imageHtml=linkImage.emitHTML;
    linkHtml=createItemWithTooltip(imageHtml,linkHyper,linktooltip,'linkview');
end

function deletelinkHtml=createDeleteLink(uuid)
    linkIcon=slreq.gui.LinkDetails.deletIcon;
    linkHyper=sprintf('slreq.gui.LinkDetails.deleteLink(''%s'')',uuid);
    linktooltip=getString(message('Slvnv:slreq:DeleteLink'));
    linkImage=Advisor.Image;
    linkImage.ImageSource=linkIcon;
    linkImage.setAttribute('class','deletelinkicon');

    imageHtml=linkImage.emitHTML;
    deletelinkHtml=createItemWithTooltip(imageHtml,linkHyper,linktooltip,'deletelink');
end

function maxToolTipLine=updateToolTipLine(maxToolTipLine,tooltip)
    newToolTipLine=numel(strsplit(tooltip,'<br>'));
    if newToolTipLine>maxToolTipLine
        maxToolTipLine=newToolTipLine;
    end
end

function linkTargetClass=getLinkTargetClass(linkSrcDst)
    if strcmpi(linkSrcDst.domain,'linktype_rmi_simulink')
        if isa(linkSrcDst,'slreq.data.SourceItem')
            if isa(linkSrcDst,'slreq.data.TextRange')

                linkTargetClass='simulink-eml';
            else
                linkTargetClass=slreq.utils.getSLType(linkSrcDst.artifactUri,linkSrcDst.id);
            end
        else
            linkTargetClass=slreq.utils.getSLType(linkSrcDst.artifactUri,linkSrcDst.artifactId);
        end

    elseif strcmpi(linkSrcDst.domain,'linktype_rmi_slreq')
        if isa(linkSrcDst,'slreq.data.SourceItem')
            linkedObj=slreq.utils.getReqObjFromSourceItem(linkSrcDst);
        else
            linkedObj=linkSrcDst;
        end
        if isempty(linkedObj)
            linkTargetClass='unresolved-item';
        elseif linkedObj.external
            linkTargetClass='slreq-ex';
        elseif linkedObj.isJustification
            linkTargetClass='slreq-justification';
        else
            linkTargetClass='slreq-in';
        end
    elseif slreq.data.Requirement.isExternallySourcedReqIF(linkSrcDst.domain)

        linkTargetClass='slreq-ex';
    else
        linkTargetClass=strrep(linkSrcDst.domain,'_','-');
    end
end
